export const HeaderElements = ({name})=>{
    let href = <a href='#'>{name}</a>;

    if(name == '0876 442 740' || name == '0878 222 317'){
        href = <a href='tel:{name}'>{name}</a>;

    } else if(name == 'priateli@abv.bg'){
        return (
            <li className='navItem'>
                <a href='mailto:{name}'>{name}</a>
            </li>  
        )
    } 

    return (
        <li className='navItem'>
            {href}
        </li>
    )
}
